import Header from "../components/Header";
import Paket from "../components/Paket";
import Footer from "../components/Footer";
import Snk from "../components/Snk";

const Product = () => {
    return (
        <>
        <Header />
        <Paket />
        <Snk />
        <Footer />
        </>
    )
}

export default Product
